      <body>

      								<div style="position:absolute; top:0px; right:0px;">
                                        <img _title="This is a Popular File" alt="" class="ipsImage" data-ipstooltip="" src="https://www.simtropolis.com/library/misc/big-heart-icon.png" style="" width="34" height="53">
      								</div>










      <p> </p>

      <p>

      </p>

      <p align="justify">This is a collection of 7 container ship props to be used with the upcoming <span style="font-weight:bold;color:rgb(0,0,102);"><abbr title="Pegasus">PEG</abbr>-<abbr
      title="Coastal Development Kit 3">CDK3</abbr> Seaport</span> (<abbr title="Coastal Development Kit 3">CDK3</abbr>-SP) series of lots. It is a required dependency, specifically, for the Container
      Ship Seaport lot and may be used with other <span style="font-weight:bold;color:rgb(51,0,153);"><abbr title="Coastal Development Kit 3">CDK3</abbr>-SP</span> lots.</p>

